INSERT INTO `wp_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(1447, 176, 'agent_policy_main_content', '<h4>Mục đích sử dụng thông tin cá nhân</h4>\r\na) Liên hệ với bạn để cung cấp cho bạn các dịch vụ phù hợp với nhu cầu của bạn\r\nb) Liên hệ với\r\nbạn để trả lời các câu hỏi của bạn\r\n<ul class=\"list mt25\">\r\n 	<li>Chúng tôi sẽ thu thập thông tin cá nhân cần thiết cho các mục đích trên bằng các phương thức\r\ncông bằng và phù hợp.</li>\r\n 	<li>Chúng tôi nhận được sự đồng ý của bạn khi thu thập những thông tin cá nhân cần được lưu ý.</li>\r\n 	<li>Thông tin cá nhân nhận được sẽ không được sử dụng cho bất kỳ mục đích nào khác ngoài các mục\r\nđích trên mà không có sự đồng ý của cá nhân.</li>\r\n 	<li>Chúng tôi sẽ thực hiện các biện pháp để ngăn chặn rò rỉ thông tin và giám sát không chỉ nhân\r\nviên mà cả các bên nhận ủy thác.</li>\r\n 	<li>Bất kể đó là ở trong hay ngoài nước, chúng tôi sẽ không cung cấp thông tin cho bên thứ ba mà\r\nkhông có sự đồng ý của cá nhân, trừ khi được pháp luật cho phép.</li>\r\n 	<li>Chúng tôi sẽ tiết lộ thông tin cá nhân của người đó khi có sự yêu cầu từ người đó.</li>\r\n 	<li>Nếu thông tin cá nhân được tiết lộ khác với sự thật, chúng tôi sẽ chỉnh sửa hoặc xóa thông\r\ntin đó.</li>\r\n 	<li>Chúng tôi sẽ phản hồi thích hợp và kịp thời các khiếu nại liên quan đến việc xử lý thông tin\r\ncá nhân.</li>\r\n 	<li>Chính sách bảo vệ thông tin cá nhân này được áp dụng trong trang web này.</li>\r\n</ul>'),
(1448, 176, '_agent_policy_main_content', 'field_6471be8cbe2b9'),
(1449, 176, 'agent_policy_contact', 'scsoft@gmail.com'),
(1450, 176, '_agent_policy_contact', 'field_6471beb6be2ba'),
(1451, 176, 'agent_policy_google_analytics', 'Để cung cấp dịch vụ tốt hơn và cải thiện khả năng sử dụng của trang web, trang web này sử dụng\r\nGoogle Analytics để thu thập và phân tích dữ liệu chẳng hạn như trạng thái sử dụng trang web.\r\nVào thời điểm đó, Google có thể thông qua “cookie” để thu thập thông tin như địa chỉ IP của bạn,\r\nnhưng thông tin được thu thập bởi “cookie” không thể nhận dạng được cá nhân.\r\nCác thông tin\r\nđược thu thập cũng được quản lý bởi chính sách bảo mật của Google.\r\nBằng cách sử dụng trang\r\nweb này, được cho rằng bạn đã đồng ý với việc xử lý dữ liệu do Google và trang web này thực hiện\r\ntheo các phương pháp và mục đích trên'),
(1452, 176, '_agent_policy_google_analytics', 'field_6471beddbe2bb'),
(1453, 176, 'agent_policy_google', '<ul>\r\n 	<li class=\"link-policy\"><a href=\"https://policies.google.com/privacy?hl=ja\" target=\"_blank\" rel=\"noopener\">https://policies.google.com/privacy?hl=ja</a></li>\r\n 	<li class=\"link-policy\"><a href=\"https://policies.google.com/technologies/partner-sites?hl=ja\" target=\"_blank\" rel=\"noopener\">https://policies.google.com/technologies/partner-sites?hl=ja</a></li>\r\n</ul>'),
