(1533, 230, '_form', '<div class=\"tbl-contact\">\n    <dl class=\"first\">\n        <dt>\n            <em class=\"ninni\">任意</em>\n            <span class=\"ttl text-center\">Tên công ty/Tên đại lý</span>\n        </dt>\n        <dd>\n            [text company id:company placeholder \"例）株式会社ステージアジアジャパン\"]\n        </dd>\n    </dl>\n    <dl>\n        <dt>\n            <em class=\"hissu\">必須</em>\n            <span class=\"ttl text-center\">Tên</span>\n        </dt>\n        <dd>\n            [text* your-name id:name placeholder \"お名前をご入力ください。\"]\n        </dd>\n    </dl>\n    <dl>\n        <dt>\n            <em class=\"hissu\">必須</em>\n            <span class=\"ttl text-center\">Địa chỉ Email</span>\n        </dt>\n        <dd>\n            [email* email id:mail placeholder \"例）abc@sample.jp\"]\n            <p class=\"mt15\">確認のため、もう⼀度ご⼊⼒ください。</p>\n            [email* c_email id:c_email placeholder \"例）abc@sample.jp\"]\n        </dd>\n    </dl>\n    <dl>\n        <dt>\n            <em class=\"ninni\">任意</em>\n            <span class=\"ttl text-center\">Điện thoại liên hệ</span>\n        </dt>\n        <dd>\n            [tel tel id:tel placeholder \"例）03-3263-0219\"]\n        </dd>\n    </dl>\n    <dl>\n        <dt class=\"last\">\n            <em class=\"hissu\">必須</em>\n            <span class=\"ttl text-center\">Nội dung</span>\n        </dt>\n        <dd>\n            [textarea* comment id:comment placeholder \"例）sample\"]\n        </dd>\n    </dl>\n</div>\n<div class=\"consent_txt\">\n    <label>\n        [acceptance agreement id:consent_check optional] <a href=\"\">Đồng ý chính sách bảo mật</a><br>[/acceptance]\n    </label>\n    <p>※Nếu bạn không đồng ý, bạn sẽ không thể gửi.</p>\n</div>\n<div class=\"form-btn-block\">\n    <div class=\"btn\">\n        <div class=\"form-btn\">\n            [submit id:submit_btn class:fnt-roboto \"Tiến hành xác nhận nội dung\"]\n        </div>\n    </div>\n</div>'),
