(1637, 234, 'agent_policy_google_analytics', 'Để cung cấp dịch vụ tốt hơn và cải thiện khả năng sử dụng của trang web, trang web này sử dụng\r\nGoogle Analytics để thu thập và phân tích dữ liệu chẳng hạn như trạng thái sử dụng trang web.\r\nVào thời điểm đó, Google có thể thông qua “cookie” để thu thập thông tin như địa chỉ IP của bạn,\r\nnhưng thông tin được thu thập bởi “cookie” không thể nhận dạng được cá nhân.\r\nCác thông tin\r\nđược thu thập cũng được quản lý bởi chính sách bảo mật của Google.\r\nBằng cách sử dụng trang\r\nweb này, được cho rằng bạn đã đồng ý với việc xử lý dữ liệu do Google và trang web này thực hiện\r\ntheo các phương pháp và mục đích trên'),
