(2902, 289, 'about_ja_desc', 'ステージアジアジャパンはベトナムを中⼼とした、アジア諸国への海外進出をサポートする会社です。<br>\r\n2014年よりベトナムホーチミンに拠点を持ちオフショア開発に携わってきました。<br>\r\n現在では化粧品や健康⾷品などの輸出事業を、主にベトナムを中⼼としたASEAN諸国に展開しており、輸出に必要なFDA認可の取得から、⽇本国 <br>\r\n内におけるEPAコンサルティング、販路開拓まで、そのすべてを⽇本法⼈であるステージアジアジャパンがワンストップで対応しています'),
