(85, 1, '2023-05-22 15:00:17', '2023-05-22 15:00:17', '<div class=\"list-content-in-post\">\r\n<h3>目次 [<span class=\"c_primary\">非表示</span>]</h3>\r\n<a href=\"#セクションその1\">セクションその1</a> <a href=\"#セクションその2\">セクションその2</a> <a href=\"#セクションその3\">セクションその3</a>\r\n<div class=\"sub\"><a href=\"#セクション3のサブセクションその1\">セクション3のサブセクションその1</a> <a href=\"#セクション3のサブセクションその2\">セクション3のサブセクションその2</a></div>\r\n<a href=\"#セクションその4\">セクションその4</a></div>\r\n<div class=\"post-content wysiwyg\">\r\n<h2 id=\"セクションその1\">見出しテキストパターンその1です</h2>\r\n<h3 id=\"セクションその2\">見出しテキストパターンその2です</h3>\r\n<p>左寄せテキスト <a href=\"#\">リンクテキストはこのように</a>。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。</p>\r\n<p class=\"text-center\">中央寄せせテキスト<br />テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。</p>\r\n<p class=\"text-right\">右寄せせテキスト<br />テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。</p>\r\n<h4 id=\"セクションその3\">見出しテキストパターンその3です</h4>\r\n<h5>見出しテキストパターンその4です</h5>\r\n<p>htmlの&lt;ol&gt;要素の入力イメージ</p>\r\n<ol>\r\n<li>ミカン属（カンキツ属）</li>\r\n<li>キンカン属</li>\r\n<li>カラタチ属</li>\r\n</ol>\r\n<p>htmlの&lt;ul&gt;要素の入力イメージ</p>\r\n<ul>\r\n<li>ミカン属（カンキツ属）</li>\r\n<li>キンカン属</li>\r\n<li>カラタチ属</li>\r\n</ul>\r\n<p>htmlの&lt;strike&gt;要素の入力イメージ <span style=\"text-decoration: line-through;\">文字列に取り消し線（水平線）を引きます。</span></p>\r\n<p>htmlの&lt;blockquote&gt;要素の入力イメージ</p>\r\n<blockquote>他社メーカーの美⽩化粧⽔を使っていましたが効果が⾒られないので替えようと思い購⼊しました。上品なバラの⾹りがして癒されます。少しとろみがあり乾燥肌にも良さそうです。医薬部外品なので美⽩効果も期待出来そうです。続けてみたいと思います。（購⼊者さん）</blockquote>\r\n<p>htmlの&lt;table&gt;要素の入力イメージ</p>\r\n<table>\r\n<thead>\r\n<tr>\r\n<th>thead&gt; ... &gt; th</th>\r\n<th>見出し項目名</th>\r\n<th>見出し項目名</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<th>tboty &gt; ... &gt; th</th>\r\n<td>tboty &gt; ... &gt; td</td>\r\n<td>通常セル内容</td>\r\n</tr>\r\n<tr>\r\n<th>キーセル</th>\r\n<td>通常セル内容</td>\r\n<td>通常セル内容</td>\r\n</tr>\r\n<tr>\r\n<th>キーセル</th>\r\n<td>通常セル内容</td>\r\n<td>通常セル内容</td>\r\n</tr>\r\n</tbody>\r\n<caption>table要素がcaption要素を含む場合</caption></table>\r\n<h6>見出しテキストパターンその5です</h6>\r\n<div class=\"clearfix\">\r\n<figure class=\"pull-left\"><img src=\"&lt;?php bloginfo(\" />/assets/vn/images/item/img2.jpg\" alt=\"見出しテキストパターンその5です\"&gt;</figure>\r\n<div class=\"txt pull-right\">←左寄せ画像のイメージ。画像が左にフロートしている場合です。横に入るこのテキストは、画像との間に標準サイズテキスト16pxの2em分、すなわち32pxの余白がある状態です。画像の右側にマージンのスタイルを設定します。</div>\r\n</div>\r\n<figure class=\"m-auto table\"><img src=\"&lt;?php bloginfo(\" />/assets/vn/images/item/img3.jpg\" alt=\"画像がキャプション要素を持つ場合\"&gt;\r\n<figcaption>画像がキャプション要素を持つ場合</figcaption>\r\n</figure>\r\n<p>↑中央揃え画像のイメージ。text-aign:centerもしくはmarginのX軸を auto にスタイル設定したような状態。キャプションは他の配置でも入る可能性あり。</p>\r\n<div class=\"clearfix\">\r\n<div class=\"pull-left\">→右寄せ画像のイメージ。画像が右にフロートしている場合です。横に入るこのテキストは、画像との間に標準サイズテキスト16pxの2em分、すなわち32pxの余白がある状態です。画像の左側にマージンのスタイルを設定します。</div>\r\n<figure class=\"pull-right\"><img src=\"&lt;?php bloginfo(\" />/assets/vn/images/item/img4.jpg\" alt=\"img4\"&gt;</figure>\r\n</div>\r\n<p>YouTubeのiframe埋込のイメージ</p>\r\n<iframe title=\"YouTube video player\" src=\"https://www.youtube.com/embed/OIdMkZyhx7E\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>\r\n<p>Google / Yahooなどの広告バナー挿入イメージ</p>\r\n<div class=\"ads clearfix\">\r\n<figure class=\"pull-left\"><img src=\"&lt;?php bloginfo(\" />/assets/vn/images/item/img7.jpg\" alt=\"ads\"&gt;</figure>\r\n<figure class=\"pull-right\"><img src=\"&lt;?php bloginfo(\" />/assets/vn/images/item/img8.jpg\" alt=\"ads\"&gt;</figure>\r\n</div>\r\n</div>', 'Nhập tên sản phẩm.Nhập tên sản phẩm.Nhập tên sản phẩm.Nhập tên sản phẩm. 12', '', 'publish', 'open', 'open', '', 'nhap-ten-san-pham-nhap-ten-san-pham-nhap-ten-san-pham-nhap-ten-san-pham-4', '', '', '2023-05-27 06:35:30', '2023-05-27 06:35:30', '', 0, 'http://localhost:8080/scsoft/beau