(189, 1, '2023-05-27 06:33:55', '2023-05-27 06:33:55', '<!-- wp:paragraph -->\r\n<pre>&lt;div class=\"list-content-in-post\"&gt;<br />    &lt;h3&gt;目次 [&lt;span class=\"c_primary\"&gt;非表示&lt;/span&gt;]&lt;/h3&gt;<br />    &lt;a href=\"#セクションその1\"&gt;セクションその1&lt;/a&gt;<br />    &lt;a href=\"#セクションその2\"&gt;セクションその2&lt;/a&gt;<br />    &lt;a href=\"#セクションその3\"&gt;セクションその3&lt;/a&gt;<br />    &lt;div class=\"sub\"&gt;<br />        &lt;a href=\"#セクション3のサブセクションその1\"&gt;セクション3のサブセクションその1&lt;/a&gt;<br />        &lt;a href=\"#セクション3のサブセクションその2\"&gt;セクション3のサブセクションその2&lt;/a&gt;<br />    &lt;/div&gt;<br />    &lt;a href=\"#セクションその4\"&gt;セクションその4&lt;/a&gt;<br />&lt;/div&gt;<br />&lt;div class=\"post-content wysiwyg\"&gt;<br />    &lt;h2 id=\"セクションその1\"&gt;見出しテキストパターンその1です&lt;/h2&gt;<br />    &lt;h3 id=\"セクションその2\"&gt;見出しテキストパターンその2です&lt;/h3&gt;<br />    &lt;p&gt;左寄せテキスト &lt;a href=\"#\"&gt;リンクテキストはこのように&lt;/a&gt;。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。<br />    &lt;/p&gt;<br />    &lt;p class=\"text-center\"&gt;中央寄せせテキスト&lt;br&gt;テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。<br />    &lt;/p&gt;<br />    &lt;p class=\"text-right\"&gt;右寄せせテキスト&lt;br&gt;テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。テキストが⼊ります。<br />    &lt;/p&gt;<br />    &lt;h4 id=\"セクションその3\"&gt;見出しテキストパターンその3です&lt;/h4&gt;<br />    &lt;h5&gt;見出しテキストパターンその4です&lt;/h5&gt;<br />    &lt;p&gt;htmlの&amp;lt;ol&amp;gt;要素の入力イメージ&lt;/p&gt;<br />    &lt;ol&gt;<br />        &lt;li&gt;ミカン属（カンキツ属）&lt;/li&gt;<br />        &lt;li&gt;キンカン属&lt;/li&gt;<br />        &lt;li&gt;カラタチ属&lt;/li&gt;<br />    &lt;/ol&gt;<br />    &lt;p&gt;htmlの&amp;lt;ul&amp;gt;要素の入力イメージ&lt;/p&gt;<br />    &lt;ul&gt;<br />        &lt;li&gt;ミカン属（カンキツ属）&lt;/li&gt;<br />        &lt;li&gt;キンカン属&lt;/li&gt;<br />        &lt;li&gt;カラタチ属&lt;/li&gt;<br />    &lt;/ul&gt;<br />    &lt;p&gt;htmlの&amp;lt;strike&amp;gt;要素の入力イメージ &lt;strike&gt;文字列に取り消し線（水平線）を引きます。&lt;/strike&gt;&lt;/p&gt;<br />    &lt;p&gt;htmlの&amp;lt;blockquote&amp;gt;要素の入力イメージ&lt;/p&gt;<br />    &lt;blockquote&gt;<br />        他社メーカーの美⽩化粧⽔を使っていましたが効果が⾒られないので替えようと思い購⼊しました。上品なバラの⾹りがして癒されます。少しとろみがあり乾燥肌にも良さそうです。医薬部外品なので美⽩効果も期待出来そうです。続けてみたいと思います。（購⼊者さん）<br />    &lt;/blockquote&gt;<br />    &lt;p&gt;htmlの&amp;lt;table&amp;gt;要素の入力イメージ&lt;/p&gt;<br />    &lt;table&gt;<br />        &lt;thead&gt;<br />        &lt;tr&gt;<br />            &lt;th&gt;thead&gt; ... &gt; th&lt;/th&gt;<br />            &lt;th&gt;見出し項目名&lt;/th&gt;<br />            &lt;th&gt;見出し項目名&lt;/th&gt;<br />        &lt;/tr&gt;<br />        &lt;/thead&gt;<br />        &lt;tbody&gt;<br />        &lt;tr&gt;<br />            &lt;th&gt;tboty &gt; ... &gt; th&lt;/th&gt;<br />            &lt;td&gt;tboty &gt; ... &gt; td&lt;/td&gt;<br />            &lt;td&gt;通常セル内容&lt;/td&gt;<br />        &lt;/tr&gt;<br />        &lt;tr&gt;<br />            &lt;th&gt;キーセル&lt;/th&gt;<br />            &lt;td&gt;通常セル内容&lt;/td&gt;<br />            &lt;td&gt;通常セル内容&lt;/td&gt;<br />        &lt;/tr&gt;<br />        &lt;tr&gt;<br />            &lt;th&gt;キーセル&lt;/th&gt;<br />            &lt;td&gt;通常セル内容&lt;/td&gt;<br />            &lt;td&gt;通常セル内容&lt;/td&gt;<br />        &lt;/tr&gt;<br />        &lt;/tbody&gt;<br />        &lt;caption&gt;table要素がcaption要素を含む場合&lt;/caption&gt;<br />    &lt;/table&gt;<br />    &lt;h6&gt;見出しテキストパターンその5です&lt;/h6&gt;<br />    &lt;div class=\"clearfix\"&gt;<br />        &lt;figure class=\"pull-left\"&gt;&lt;img src=\"&lt;?php bloginfo(\"template_url\"); ?&gt;/assets/vn/images/item/img2.jpg\"<br />                                       alt=\"見出しテキストパターンその5です\"&gt;<br />        &lt;/figure&gt;<br />        &lt;div class=\"txt pull-right\"&gt;<br />            ←左寄せ画像のイメージ。画像が左にフロートしている場合です。横に入るこのテキストは、画像との間に標準サイズテキスト16pxの2em分、すなわち32pxの余白がある状態です。画像の右側にマージ