(297, 1, '2023-05-28 11:54:47', '2023-05-28 11:54:47', '<h2>Heading 1</h2>\r\n<h3>heading 2</h3>\r\nnội dung ở đây chứ đâu\r\n<h3>Heading 1</h3>\r\nIt can be discouraging to spend time <a href=\"https://themeisle.com/blog/engaging-content/\">crafting content</a> for your website, only to have users quickly click away. Since most people scan text on the web, you may have better luck holding their attention if they can skip right to what they’re looking for, by providing them with a table of contents in WordPress.\r\n\r\nA table of contents can make it a lot easier for readers to find exactly what they’re interested in, especially with <a href=\"https://themeisle.com/blog/long-form-content/\">longer content</a>. It can also be helpful for Search Engine Optimization (SEO). Fortunately, whether you have some coding knowledge or you’re a complete beginner, adding a table of contents is a pretty simple process.\r\n\r\nIn this post, we’ll show you three ways to create a table of contents for a WordPress site, including using plugins and a manual approach.\r\n<h4>heading 4</h4>\r\n<h5>heading 5</h5>\r\n<ul>\r\n 	<li>o what they’re looking for, by providing them with a table of contents in WordPress.</li>\r\n 	<li>A table of contents can make it a lot easier for readers to find exactly what they’re interested in, especially with <a href=\"https://themeisle.com/blog/long-form-content/\">longer content</a>. It can also be helpful for Search Engine Optimization (SEO). Fortunately, whether you have some coding knowledge or you’re a complete beginner, adding a table of contents is a pretty simple process.</li>\r\n 	<li>In this post, we’ll show yo</li>\r\n</ul>\r\n<h2>Heading 2</h2>', 'Nhập tên sản phẩm.Nhập tên sản phẩm.Nhập tên sản phẩm.Nhập tên sản phẩm.', '', 'inherit', 'closed', 'closed', '', '203-autosave-v1', '', '', '2023-05-28 11:54:47', '2023-05-28 11:54:47', '', 203, 'http://localhost:8080/scsoft/beauty/?p=297', 0, 'revision', '', 0),
